import React from 'react'

import BlsLink from "./BlsLink"
import sidebarData from "./data/sidebarData"


function LinkGroup() {
    const linkGroup = sidebarData.map(button => <button onClick={val.handleClick}>><BlsLink {...button}></BlsLink></button>)

    return (
        <div>
            <ul>
                {linkGroup}
            </ul>
        </div>
    )
}

export default LinkGroup
